Mete asye klòch sele valv glòb
1. Creole konsepsyon de doub-miray so klòch
2. Chalè-dissipating bonn konsepsyon;
3. Avèk aparèy depo librifyan;
4, Avèk konsepsyon circlip ranje tij nwa;
5. Estrikti pwodwi rezonab, pèfòmans fermeture serye ak bon aparans;
6. Se sifas la sele soude ak Ko-ki baze sou alyaj difisil, ki te gen bon rezistans mete, rezistans korozyon, anti-friksyon pèfòmans ak lavi sèvis long;
7. Tij gen tretman nitrid ak bon rezistans korozyon ak pèfòmans anti-friksyon;
8. Avèk endikatè pozisyon pou mouvman tij;
1. Nou espesyalize nan manifakti valv plis pase 30 ane.
2. Varyete ki pi konplètman tiyo yo, te devlope 70 seri plis pase 1600 modèl.
3. Segondè bon jan kalite, nou te jwenn sètifika tankou ISO, API, CE, PED, ABS, UC, BV, FM, WRAS, DV, GW, DNV, LR, BV.
