1. DESKRIPSYON
XZWD bi bi nan seri 232 estanda a gen yon ranje kat pwen woulo bi ak nilon spacer.
Pwodwi sa yo se bag fòje, trete nan yon estrikti, ak yon enteryè, seksyon kare, bag angrenaj rijid ak yon bag bride ekstèn. Bi XZWD slewing yo bay ak pre-grese grès nan seri a 232 estanda.
2. AVANTAJ
232 estanda seri XZWD rotary BEARINGS yo gen yon bon balans ant pèfòmans ak rèd, ak sèlman yon sèl bag bride ekstèn.
Avantaj reyèl la nan estrikti a se ke li fasil yo rasanble, ak sele a doub vle di li ka menm dwe enstale deyò oswa nan yon anviwònman pousyè.
XZWD 232 estanda seri slewbacks kapab tou Thorne nan gwo vitès (30 RPM) anba charj ki ba.
3. APLIKASYON JADEN
232 estanda seri sipò XZWD yo itilize nan yon varyete aplikasyon pou, tankou:
* platin;
* Tab soude;
* Pwosesis endistri automatisation;
* Endistri anbalaj;
* Limyè teknik;
* Limyè pwòp tèt ou-lanse teknik;
* Blendè;
* Limyè bobine;
* Coiler;
* elatriye
